#!/usr/bin/env python3
# Single-file bundle for AirflowCommander
# This script contains the entire project as a base64 zip and will extract to a temp directory, then run the entry point.
# Generated by ChatGPT on request.
import base64, io, os, sys, tempfile, zipfile, runpy, shutil

B64_ZIP = """"""
ENTRY_RELATIVE_PATH = "AirflowCommander/app.py"

def main(argv=None):
    argv = sys.argv if argv is None else argv
    if ENTRY_RELATIVE_PATH is None:
        print("ERROR: Could not determine an entry point. Please open this file and set ENTRY_RELATIVE_PATH to your main script within the bundle.")
        sys.exit(2)
    # Create temp dir and extract
    temp_root = tempfile.mkdtemp(prefix="airflowcommander_")
    try:
        zdata = base64.b64decode(B64_ZIP.encode('ascii'))
        with zipfile.ZipFile(io.BytesIO(zdata), 'r') as zf:
            zf.extractall(temp_root)
        # Change cwd to project root
        os.chdir(temp_root)
        # Add project root to sys.path for imports
        if temp_root not in sys.path:
            sys.path.insert(0, temp_root)
        target = os.path.join(temp_root, ENTRY_RELATIVE_PATH)
        if not os.path.isfile(target):
            print(f"ERROR: Entry point '{ENTRY_RELATIVE_PATH}' not found inside bundled project.")
            sys.exit(2)
        # Execute the entry script in __main__ context so argparse/click work as expected
        runpy.run_path(target, run_name="__main__")
    finally:
        # Keep extracted files for debugging if env var set; else clean up on exit
        if os.environ.get("BUNDLE_KEEP_EXTRACTED", ""):
            print(f"Keeping extracted project at: {temp_root} (BUNDLE_KEEP_EXTRACTED is set)")
        else:
            try:
                shutil.rmtree(temp_root)
            except Exception:
                pass

if __name__ == "__main__":
    main()
